import React from "react";
import Deck from "./Deck"

export default function DeckList({ decks }) {

    return (
        <div className="card-grid">
            {decks.map(deck => {
               return <Deck deck={deck} key={deck.id}/>
            })}
            <button>View</button>
            <button>Study</button>
        </div>
    )
}
